fragment:
@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multi_tissue_structure rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :tissue ],
        :multicellular_anatomical_structure ;
    :has_definition "Anatomical structure that has as its parts two or more portions of tissue of at least two different types and which through specific morphogenetic processes forms a single distinct structural unit demarcated by bona-fide boundaries from other distinct structural units of different types." ;
    :has_related_synonym "multi-tissue structures" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epithelium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :basement_membrane_of_epithelium ],
        :tissue ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :multilaminar_epithelium ;
                    rdf:rest [ rdf:first :unilaminar_epithelium ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Portion of tissue, that consists of one or more layers of epithelial cells connected to each other by cell junctions and which is underlain by a basal lamina. Examples: simple squamous epithelium, glandular cuboidal epithelium, transitional epithelium, myoepithelium[CARO]." ;
    :has_exact_synonym "epithelial tissue",
        "portion of epithelium" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:simple_cuboidal_epithelium rdfs:subClassOf :cuboidal_epithelium,
        :unilaminar_epithelium ;
    :has_definition "Unilaminar epithelium that consists of a single layer of cuboidal cells." ;
    :has_exact_synonym "epithelium simplex cuboideum" ;
    :has_related_synonym "simple cuboidal epithelia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:simple_columnar_epithelium rdfs:subClassOf :columnar_epithelium,
        :unilaminar_epithelium ;
    :has_broad_synonym "columnar epithelium",
        "columnar epithlium" ;
    :has_definition "Unilaminar epithelium, which consists of a single layer of columnar cells. Examples: ciliated columnar epithelium, gastric epithelium, microvillus columnar epithelium.[FMA]." ;
    :has_exact_synonym "epithelium simplex columnare",
        "simple columnar epithelium" ;
    :has_related_synonym "simple columnar epithelia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:multilaminar_epithelium rdfs:subClassOf :epithelium ;
    :has_definition "Epithelium which consists of more than one layer of epithelial cells that may or may not be in contact with a basement membrane. Examples: keratinized stratified squamous epithelium, ciliated stratified columnar epithelium.[FMA]." ;
    :has_exact_synonym "stratified epithelium" ;
    :has_related_synonym "laminated epithelium" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:atypical_epithelium rdfs:subClassOf :epithelium ;
    :has_definition "Epithelium that consists of epithelial cells not arranged in one ore more layers." ;
    :has_exact_synonym "heterogenous epithelium" ;
    :has_related_synonym "atypical epithelia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cavitated_compound_organ rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :anatomical_cavity ],
        :compound_organ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :compound_organ ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom :anatomical_cavity ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Compound organ that contains one or more macroscopic anatomical spaces." ;
    :has_exact_synonym "cavitated organ" ;
    :has_related_synonym "cavitated compound organs" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:unilaminar_epithelium rdfs:subClassOf :epithelium ;
    :has_definition "Epithelium which consists of a single layer of epithelial cells. Examples: endothelium, mesothelium, glandular squamous epithelium.[FMA]." ;
    :has_exact_synonym "simple epithelium" ;
    :has_related_synonym "unilaminar epithelia" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chyme rdfs:subClassOf :bodily_fluid,
        :ingested_food ;
    :has_definition "A semifluid mass of partly digested food expelled by the stomach into the duodenum." ;
    :has_exact_synonym "chymus" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:chyle rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :lymph ],
        :caro_0000000,
        :organism_substance ;
    :has_definition "Chyle is a bodily fluid consisting of a milky fluid consisting of lymph and emulsified fats; formed in the small intestine during digestion of ingested fats." .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mucus rdfs:subClassOf :bodily_fluid,
        :secretion_of_exocrine_gland ;
    :has_definition "Mucus is a bodily fluid consisting of a slippery secretion of the lining of the mucous membranes in the body. It is a viscous colloid containing antiseptic enzymes (such as lysozyme) and immunoglobulins. Mucus is produced by goblet cells in the mucous membranes that cover the surfaces of the membranes. It is made up of mucins and inorganic salts suspended in water." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:interstitial_fluid rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :tissue ],
        :organism_substance ;
    :has_definition "Interstitial fluid is a bodily fluid consisting of a solution which bathes and surrounds the cells of multicellular animals. It is the main component of the extracellular fluid, which also includes plasma and transcellular fluid." ;
    :has_exact_synonym "intercellular fluid",
        "tissue fluid" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:thoracic_segment_of_trunk rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :thoracic_skeleton ],
        :subdivision_of_organism_along_main_body_axis,
        :subdivision_of_trunk ;
    :has_definition "Subdivision of trunk that lies between the head and the abdomen." ;
    :has_exact_synonym "thorax" ;
    :has_related_synonym "anterior subdivision of trunk",
        "upper body",
        "upper trunk" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:embryo rdfs:subClassOf :multicellular_organism ;
    :has_definition "Anatomical entity that comprises the organism in the early stages of growth and differentiation that are characterized by cleavage, the laying down of fundamental tissues, and the formation of primitive organs and organ systems. For example, for mammals, the process would begin with zygote formation and end with birth. For insects, the process would begin at zygote formation and end with larval hatching. For plant zygotic embryos, this would be from zygote formation to the end of seed dormancy. For plant vegetative embryos, this would be from the initial determination of the cell or group of cells to form an embryo until the point when the embryo becomes independent of the parent plant." ;
    :has_exact_synonym "embryonic organism" ;
    :has_related_synonym "developing organism",
        "developmental tissue" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:germ_layer rdfs:subClassOf :germ_layer_neural_crest ;
    :has_broad_synonym "embryonic tissue" ;
    :has_definition "A layer of cells produced during the process of gastrulation during the early development of the animal embryo, which is distinct from other such layers of cells, as an early step of cell differentiation. The three types of germ layers are the endoderm, ectoderm, and mesoderm." ;
    :has_exact_synonym "germinal layer" ;
    :has_narrow_synonym "primary germ layer" ;
    :has_related_synonym "embryonic germ layer",
        "embryonic germ layers" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:ectoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_ectoderm ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_ectoderm ],
        :germ_layer ;
    :has_definition "Primary germ layer that is the outer of the embryo's three germ layers and gives rise to epidermis and neural tissue." ;
    :has_exact_synonym "embryonic ectoderm" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:endoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_endoderm ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_endoderm ],
        :germ_layer ;
    :has_definition "Primary germ layer that lies remote from the surface of the embryo and gives rise to internal tissues such as gut." ;
    :has_related_synonym "entoderm" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_mesoderm ],
        :germ_layer ;
    :has_definition "The middle germ layer of the embryo, between the endoderm and ectoderm." ;
    :has_related_synonym "embryonic mesoderm",
        "entire mesoderm",
        "mesodermal mantle" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:stomodeum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :future_mouth ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :ectoderm ],
        :subdivision_of_tube ;
    :has_broad_synonym "stomodeal-hypophyseal primordium" ;
    :has_definition "Anterior part of the embryonic digestive tract that develops into a mouth. The stomodeum includes as parts an invagination of the ectoderm and the stomodeal cavity." ;
    :has_exact_synonym "mouth primordium",
        "primitive oral cavity",
        "stomatodeum",
        "stomodaeum" ;
    :has_related_synonym "mouth pit",
        "oral ectoderm",
        "oral pit" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :heart_tube ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :cardiac_chamber ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :heart_plus_pericardium ],
        :caro_0000000,
        :mesoderm_derived_structure,
        :primary_circulatory_organ,
        :structure_with_developmental_contribution_from_neural_crest,
        :thoracic_segment_organ ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :primary_circulatory_organ ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :has_part ;
                                    owl:someValuesFrom :cardiac_chamber ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "A myogenic muscular circulatory organ found in the vertebrate cardiovascular system composed of chambers of cardiac muscle. It is the primary circulatory organ." ;
    :has_exact_synonym "chambered heart",
        "vertebrate heart" ;
    :has_narrow_synonym "branchial heart" ;
    :has_related_synonym "cardium" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:brain rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :future_brain ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :central_nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :future_brain ],
        :ectoderm_derived_structure,
        :organ ;
    :has_definition "The brain is the center of the nervous system in all vertebrate, and most invertebrate, animals. Some primitive animals such as jellyfish and starfish have a decentralized nervous system without a brain, while sponges lack any nervous system at all. In vertebrates, the brain is located in the head, protected by the skull and close to the primary sensory apparatus of vision, hearing, balance, taste, and smell[WP]." ;
    :has_related_synonym "encephalon",
        "suprasegmental levels of nervous system",
        "suprasegmental structures",
        "synganglion",
        "the brain" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lens_of_camera_type_eye rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :anterior_segment_of_eyeball ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :lens_vesicle ],
        :ectoderm_derived_structure,
        :transparent_eye_structure ;
    :has_definition "Transparent part of camera-type eye that helps to refract light to be focused on the retina." ;
    :has_exact_synonym "camera-type eye lens",
        "eye lens",
        "lens",
        "lens crystallina" ;
    :has_related_synonym "crystalline lens",
        "lenses",
        "ocular lens" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:retina rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :optic_cup ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :chorioretinal_region ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :posterior_segment_of_eyeball ],
        :ectoderm_derived_structure,
        :photoreceptor_array ;
    :has_definition "The retina is the innermost layer or coating at the back of the eyeball, which is sensitive to light and in which the optic nerve terminates." ;
    :has_exact_synonym "inner layer of eyeball",
        "retina of camera-type eye",
        "tunica interna of eyeball" ;
    :has_related_synonym "Netzhaut",
        "retinas" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eye rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :visual_system ],
        :sense_organ ;
    :has_definition "An organ that detects light." ;
    :has_related_synonym "light-detecting organ",
        "visual apparatus" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skeletal_joint rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :connects ;
            owl:someValuesFrom :skeletal_element ],
        :articulation ;
    owl:disjointWith :bone_element ;
    owl:equivalentClass [ owl:unionOf [ rdf:first :synovial_joint ;
                    rdf:rest [ rdf:first :nonsynovial_joint ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "articulation",
        "joint" ;
    :has_definition "Anatomical cluster that consists of two or more adjacent skeletal structures, which may be interconnected by various types of tissue[VSAO]." ;
    :has_related_synonym "articular joint",
        "joints" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gonad rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :gonad_primordium ],
        :reproductive_organ ;
    :has_definition "Reproductive organ that produces and releases eggs (ovary) or sperm (testis)." ;
    :has_exact_synonym "gonada" ;
    :has_related_synonym "gonads" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skin_epidermis rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :skin_of_body ],
        :external_integument_structure,
        :outer_epithelium ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :outer_epithelium ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :skin_of_body ] ;
                            rdf:rest :nil ] ] ] ;
    :has_broad_synonym "epidermis",
        "skin" ;
    :has_definition "The outer epithelial layer of the skin that is superficial to the dermis." ;
    :has_exact_synonym "vertebrate epidermis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:respiratory_system rdfs:subClassOf :anatomical_system ;
    owl:disjointWith :circulatory_system,
        :digestive_system,
        :entire_sense_organ_system,
        :excretory_system,
        :hematopoietic_system,
        :immune_system,
        :integumental_system,
        :musculoskeletal_system,
        :nervous_system,
        :skeletal_system ;
    :has_definition "Functional system which consists of structures involved in respiration." ;
    :has_exact_synonym "apparatus respiratorius",
        "respiratory system" ;
    :has_related_synonym "Atmungssystem",
        "apparatus respiratorius",
        "systema respiratorium" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:renal_system rdfs:subClassOf :excretory_system ;
    :has_broad_synonym "excretory system" ;
    :has_definition "The renal system in an anatomical system that maintains fluid balance and contributes to electrolyte balance, acid/base balance, and disposal of nitrogenous waste products." ;
    :has_exact_synonym "systema urinaria",
        "systema urinarium",
        "urinary system",
        "urinary tract" ;
    :has_related_synonym "renal or urinary system",
        "renal/urinary system" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:circulatory_system rdfs:subClassOf :anatomical_system ;
    owl:disjointWith :entire_sense_organ_system,
        :excretory_system,
        :hematopoietic_system,
        :immune_system,
        :integumental_system,
        :musculoskeletal_system,
        :nervous_system,
        :skeletal_system ;
    :has_definition "Organ system that passes nutrients (such as amino acids and electrolytes), gases, hormones, blood cells, etc. to and from cells in the body to help fight diseases and help stabilize body temperature and pH to maintain homeostasis[WP]." ;
    :has_related_synonym "systema cardiovasculare" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:adipose_tissue rdfs:subClassOf :dense_irregular_connective_tissue ;
    owl:disjointWith :neural_tissue ;
    :has_definition "Portion of connective tissue composed of adipocytes enmeshed in areolar tissue." ;
    :has_exact_synonym "fat",
        "fat tissue",
        "fatty tissue" ;
    :has_related_synonym "adipose",
        "bodyfat",
        "fatty depot" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:musculature rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :musculature_of_body ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :muscle_organ ],
        :caro_0000000,
        :organ_system_subdivision ;
    :has_definition "A subdivision of the muscular system corresponding to a subdisivision of an organism." ;
    :has_exact_synonym "muscle group",
        "muscles set",
        "musculature",
        "musculi",
        "set of muscles",
        "set of skeletal muscles" ;
    :has_related_synonym "muscle system",
        "muscles",
        "musculature system" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nervous_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :future_nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :future_nervous_system ],
        :anatomical_system ;
    owl:disjointWith :entire_sense_organ_system,
        :excretory_system,
        :hematopoietic_system,
        :immune_system,
        :integumental_system,
        :musculoskeletal_system,
        :skeletal_system ;
    :has_definition "The nervous system is an organ system containing predominantly neuron and glial cells. In bilaterally symmetrical organism, it is arranged in a network of tree-like structures connected to a central body. The main functions of the nervous system are to regulate and control body functions, and to receive sensory input, process this information, and generate behavior [CUMBO]." ;
    :has_exact_synonym "neurological system" ;
    :has_narrow_synonym "nerve net" ;
    :has_related_synonym "systema nervosum" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:central_nervous_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :future_central_nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :future_central_nervous_system ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :nervous_system ],
        :ectoderm_derived_structure,
        :organ_system_subdivision ;
    :has_definition "The central nervous system is the core nervous system that serves an integrating and coordinating function. In vertebrates it consists of the neural tube derivatives: the brain and spinal cord. In invertebrates it includes central ganglia plus nerve cord." ;
    :has_exact_synonym "CNS",
        "systema nervosum centrale" ;
    :has_narrow_synonym "cerebrospinal axis" ;
    :has_related_synonym "neuraxis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:nerve rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :peripheral_nervous_system ],
        :neuron_projection_bundle ;
    :has_definition "An enclosed, cable-like bundle of axons in the peripheral nervous system originating in a nerve root in the central nervous system (or a condensed nervous structure) connecting with peripheral structures." ;
    :has_exact_synonym "nerves",
        "peripheral nerve" ;
    :has_related_synonym "neural subtree" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sensory_system rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :entire_sense_organ_system ],
        :non_connected_functional_system ;
    :has_definition "Anatomical system that overlaps the nervous system and is responsible for receiving and processing sensory information." ;
    :has_exact_synonym "organa sensuum",
        "sense organ subsystem",
        "sense organs",
        "sense organs set",
        "sensory subsystem",
        "sensory systems" ;
    :has_related_synonym "organa sensuum",
        "sensory organ system",
        "set of sense organs" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

