@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:iris_epithelium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :iris ],
        :atypical_epithelium,
        :eye_epithelium ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :epithelium ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :iris ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "An epithelium that is part of a iris [Automatically generated definition]." ;
    :has_exact_synonym "epithelial tissue of iris",
        "epithelium of iris",
        "epithelium pigmentosum (iris)",
        "epithelium pigmentosum iridis",
        "iris epithelial tissue",
        "iris epithelium",
        "pigmented epithelium of iris" ;
    :has_related_synonym "iris pigmented epithelium" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:epiblast_generic_ rdfs:subClassOf :embryonic_structure ;
    :has_definition "In amniote animal embryology, the epiblast is a tissue type derived either from the inner cell mass in mammals or the blastodisc in birds and reptiles. It lies above the hypoblast. In mammalian embryogenesis, the columnar cells of the epiblast are adjacent to the trophoblast, while the cuboidal cells of the hypoblast are closer to the blastocoele. The epiblast, whilst referred to as the primary ectoderm, differentiates to form all three layers of the trilaminar germ disc in a process called gastrulation[WP]. The outer of the two layers of the blastoderm that form during gastrulation, corresponding to primitive ectoderm during gastrulation and to the definitive ectoderm after gastrulation[ZFA]." ;
    :has_exact_synonym "epiblast" ;
    :has_related_synonym "blastocyst",
        "ectoblast",
        "epiblastus",
        "primitive ectoderm" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:gill rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :respiratory_system ],
        :organ ;
    :has_definition "Anatomical surface structure found in many aquatic organisms. It is a respiration organ whose function is the extraction of oxygen from water and the excretion of carbon dioxide. The microscopic structure of a gill is such that it presents a very large surface area to the external environment. Gills usually consist of thin filaments of tissue, branches, or slender tufted processes which have a highly folded surface to increase surface area. A high surface area is crucial to the gas exchange of aquatic organisms as water contains only 1/20 parts dissolved Oxygen compared to air. With the exception of some aquatic insects, the filaments and lamellae (folds) contain blood or coelomic fluid, from which gases are exchanged through the thin walls. Oxygen is carried by the blood to other parts of the body. Carbon dioxide passes from the blood through the thin gill tissue into the water. Gills or gill-like organs, located in different parts of the body, are found in various groups of aquatic animals, including mollusks, crustaceans, insects, fish, and amphibians." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pharyngeal_arch rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :embryonic_head ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :pharyngeal_arch_system ],
        :multi_tissue_structure,
        :protuberance,
        :structure_with_developmental_contribution_from_neural_crest ;
    :has_definition "One of a series of paired bulges that develop along the lateral walls of the foregut. The pharyngeal arches have developmental contributions from endoderm, mesoderm, and neural crest cells and are separated by anterior lateral endoderm out-pockets known as pharyngeal pouches." ;
    :has_exact_synonym "pharyngeal arches" ;
    :has_narrow_synonym "branchial arch" ;
    :has_related_synonym "arcus pharyngei",
        "visceral arch" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranial_placode rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :head ],
        :ectodermal_placode ;
    :has_broad_synonym "ectodermal placode",
        "placode" ;
    :has_definition "Ectodermal placode that develops in the head into a part of the sensory nervous system. With a few exceptions (lens, adenohypophyseal), cranial placodes are neurogenic." ;
    :has_exact_synonym "ectodermal cranial placode" ;
    :has_related_synonym "cranial placodes" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anatomical_cavity rdfs:subClassOf :anatomical_space ;
    :has_broad_synonym "cavity" ;
    :has_definition "Anatomical space which contains portions of one or more body substances and is bounded by the internal surface of one maximally connected anatomical structure. Examples: cranial cavity, pharyngeal recess space, nasal cavity, tooth socket, cavity of serous sac, lumen of stomach, lumen of artery, fornix of vagina." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:regional_part_of_brain rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :brain ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :neural_tissue ],
        :ectoderm_derived_structure,
        :regional_part_of_nervous_system ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :multi_tissue_structure ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :brain ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Anatomical divisons of the brain according to one or more criteria, e.g. cytoarchitectural, gross anatomy. Parts may be contiguous in 3D or not, e.g., basal ganglia." ;
    :has_exact_synonym "anatomical structure of brain",
        "biological structure of brain",
        "brain anatomical structure",
        "brain biological structure",
        "brain part",
        "neuraxis segment",
        "neuroanatomical region",
        "segment of brain" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:septum rdfs:subClassOf :anatomical_structure ;
    :has_definition "A wall, dividing a cavity or structure into smaller ones[WP]." ;
    :has_exact_synonym "septa" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:pre_chordal_neural_plate rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :neural_plate ],
        :ectoderm_derived_structure,
        :embryonic_tissue ;
    :has_definition "The portion of neural plate anterior to the mid-hindbrain junction." ;
    :has_related_synonym "anterior neural plate" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:presomitic_mesoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :paraxial_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_segmental_plate ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_segmental_plate ],
        :presumptive_structure ;
    :has_definition "Unsegmented field of paraxial mesoderm present posterior to the most recently formed somite pair, from which somites will form." ;
    :has_exact_synonym "segmental plate",
        "unsegmented paraxial mesoderm" ;
    :has_related_synonym "PSM",
        "presumptive somite mesoderm",
        "somitogenic mesoderm",
        "somitomeric mesoderm",
        "unsegmented mesenchyme" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:blood_island rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :lateral_plate_mesoderm ],
        :presumptive_structure ;
    :has_broad_synonym "ventral lateral plate mesoderm" ;
    :has_definition "Blood islands are structures in the developing embryo which lead to many different parts of the circulatory system. They primarily derive from plexuses formed from angioblasts. Within them, vacuoles appear through liquefaction of the central part of the syncytium into plasma. The lumen of the blood vessels thus formed is probably intracellular. The flattened cells at the periphery form the endothelium. The nucleated red blood corpuscles develop either from small masses of the original angioblast left attached to the inner wall of the lumen or directly from the flat endothelial cells. In either case the syncytial mass thus formed projects from and is attached to the wall of the vessel. Such a mass is known as a blood island and hemoglobin gradually accumulates within it. Later the cells on the surface round up, giving the mass a mulberry-like appearance. Then the red blood cells break loose and are carried away in the plasma. Such free blood cells continue to divide. Blood islands have been seen in the area vasculosa in the omphalomesenteric vein and arteries, and in the dorsal aorta[WP, unvetted]." ;
    :has_exact_synonym "blood islands" ;
    :has_related_synonym "VBI",
        "caudal hematopoietic tissue",
        "posterior ICM",
        "posterior blood island",
        "ventral blood island" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:prechordal_plate rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :axial_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :prechordal_mesoderm ],
        :embryonic_structure ;
    :has_broad_synonym "head mesenchyme",
        "head mesoderm" ;
    :has_definition "A horseshoe-shaped thickening of the endoderm at the cranial (rostral) end of the primitive streak formed by the involution of Spemann's organizer cells which, together with the notochord, induces the formation of the neural plate from the overlying ectodermal cells and contributes mesodermal type cells to the surrounding tissue." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:intermediate_mesoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :trunk_mesenchyme ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :mesoderm ],
        :embryonic_structure ;
    :has_definition "The intermediate mesoderm is located between the lateral mesoderm and the paraxial mesoderm. It develops into the kidney and gonads." ;
    :has_related_synonym "IM",
        "intermediate mesenchyme",
        "intermediate plate",
        "intermediate plate mesoderm",
        "mesenchyma intermedium" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:axial_mesoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :mesoderm ],
        :embryonic_structure ;
    :has_definition "The axial mesoderm includes the prechordal mesoderm and the chordamesoderm. It gives rise to the prechordal plate and to the notochord." ;
    :has_related_synonym "chordamesoderm" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:eye_primordium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :pre_chordal_neural_plate ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :pre_chordal_neural_plate ],
        :ecto_epithelium,
        :embryonic_tissue,
        :presumptive_structure,
        :primordium,
        :unilaminar_epithelium ;
    :has_definition "Portion of tissue that is part of the anterior neural keel and will form the optic vesicle[ZFA]. A paired ectodermal placode that becomes invaginated to form the embryonic lens vesicles." ;
    :has_exact_synonym "eye placode",
        "occular primordium",
        "ocular primordium",
        "optic placode",
        "optic placode of camera-type eye",
        "optic primordium" ;
    :has_related_synonym "eye anlage",
        "eye field",
        "optic field",
        "optic placodes" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:optic_cup rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :immature_eye ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :optic_vesicle ],
        :ectoderm_derived_structure,
        :multi_tissue_structure ;
    :has_definition "Multi-tissue structure that is comprised of neural and non-neural epithelial layers which will form the retina and retinal pigmented epithelium of the mature eye[ZFA]. double walled structured formed by expansion and invagination of the distal end of the optic vesicle that develops into the pigmented and sensory layers of the retina while the mouth of the optic cup eventually forms the pupil of the eye[MP]." ;
    :has_related_synonym "eye cup",
        "eyecup",
        "ocular cup",
        "ophtalmic cup" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lens_placode rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :immature_eye ],
        :cranial_placode,
        :immature_eye,
        :non_neurogenic_ectodermal_placode,
        :presumptive_structure ;
    :has_definition "A thickened portion of ectoderm which serves as the precursor to the lens. SOX2 and Pou2f1 are involved in its development[WP]." ;
    :has_related_synonym "lens placodes",
        "placoda lentis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:neural_plate rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_neural_plate ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_neural_plate ],
        :ecto_epithelium,
        :embryonic_tissue,
        :future_central_nervous_system ;
    :has_definition "A region of embryonic ectodermal cells that lie directly above the notochord. During neurulation, they change shape and produce an infolding of the neural plate (the neural fold) that then seals to form the neural tube[XAO]. The earliest recognizable dorsal ectodermal primordium of the central nervous system present near the end of gastrulation before infolding to form the neural keel; consists of a thickened pseudostratified epithelium[ZFA]." ;
    :has_related_synonym "lamina neuralis",
        "presumptive central nervous system" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:paraxial_mesoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :presumptive_paraxial_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :immediate_transformation_of ;
            owl:someValuesFrom :presumptive_paraxial_mesoderm ],
        :dense_mesenchyme_tissue,
        :embryonic_tissue,
        :lateral_structure ;
    :has_definition "The paraxial mesoderm is the mesoderm located bilaterally adjacent to the notochord and neural tube[GO]." ;
    :has_exact_synonym "paraxial mesenchyme",
        "somitic mesoderm" ;
    :has_related_synonym "mesoderma paraxiale" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:anterior_neural_tube rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :pre_chordal_neural_plate ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :neural_tube ],
        :embryonic_structure .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:lateral_plate_mesoderm rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :mesoderm ],
        :dense_mesenchyme_tissue,
        :embryonic_structure,
        :embryonic_tissue,
        :mesoderm_derived_structure ;
    :has_definition "Portion of the middle of the three primary germ layers of the embryo that resides on the periphery of the embryo, is continuous with the extra-embryonic mesoderm, splits into two layers enclosing the intra-embryonic coelom, and gives rise to body wall structures[MP]." ;
    :has_exact_synonym "LPM",
        "lateral mesoderm" ;
    :has_related_synonym "lateral plate",
        "lateral plate mesenchyme",
        "mesoderma laminae lateralis" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:heart_primordium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :cardiovascular_system ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :cardiogenic_splanchnic_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :lateral_plate_mesoderm ],
        [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :primary_heart_field ],
        :primordium ;
    :has_definition "Bilateral groups of cells consisting of three rows: one row of endocardial precursors medially and two rows of myocardical precursors laterally. The two populations fuse at the midline to form the heart rudiment or cone." ;
    :has_related_synonym "cardiac field",
        "fused heart primordium" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:sclerotome rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :develops_from ;
            owl:someValuesFrom :somite ],
        :developing_mesenchymal_condensation,
        :migrating_mesenchyme_population ;
    :has_definition "Ventral somitic compartment that is a precursor of the axial skeleton[XAO]. Sclerotomes eventually differentiate into the vertebrae and most of the skull. The caudal (posterior) half of one sclerotome fuses with the rostral (anterior) half of the adjacent one to form each vertebra. From their initial location within the somite, the sclerotome cells migrate medially towards the notochord. These cells meet the sclerotome cells from the other side to form the vertebral body. From this vertebral body, sclerotome cells move dorsally and surround the developing spinal cord, forming the vertebral arch[WP]." ;
    :has_exact_synonym "sclerotomes" ;
    :has_related_synonym "sclerotomus" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranial_neural_crest rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :neural_crest ],
        :ectoderm_derived_structure,
        :embryonic_tissue,
        :structure_with_developmental_contribution_from_neural_crest ;
    :has_definition "Neural crest cells (NCCs) originating in the anterior part of the developing embryo and residing between the mid-diencephalon and the forming hindbrain; cranial NCCs migrate dorsolaterally to form the craniofacial mesenchyme that differentiates into various craniofacial cartilages and bones, cranial neurons, glia, and connective tissues of the face; these cells enter the pharyngeal pouches and arches where they give rise to thymic cells, bones of the middle ear and jaw (mandible), and the odontoblasts of the tooth primordia; like their counterparts in the trunk, cranial NCCs also contribute to the developing peripheral nervous system, along with the pigmented cell (i.e. melanocyte) lineage." ;
    :has_exact_synonym "CNC",
        "cephalic neural crest",
        "cranial NCC population",
        "head NCC population" ;
    :has_related_synonym "crista neuralis cranialis",
        "head crest",
        "head neural crest" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:surface_structure rdfs:subClassOf :anatomical_structure ;
    :has_definition "Anatomical structure that overlaps the outer epithelial layer and is adjacent to the space surrounding the organism." ;
    :has_exact_synonym "anatomical surface feature" ;
    :has_related_synonym "surface feature",
        "surface region",
        "surface structures" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:compound_organ rdfs:subClassOf :organ ;
    :has_definition "Anatomical structure that has as its parts two or more multi-tissue structures of at least two different types and which through specific morphogenetic processes forms a single distinct structural unit demarcated by bona fide boundaries from other distinct anatomical structures of different types." ;
    :has_related_synonym "organ" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:mesenchyme rdfs:subClassOf :tissue ;
    :has_definition "Portion of tissue composed of mesenchymal cells (motile cells that develop from epthelia via an epithelial to mesenchymal transition) and surrounding extracellular material. Mesenchyme has different embryological origins in different metazoan taxa - in many invertebrates it derives in whole or part from ectoderm. In vertebrates it derives largely from mesoderm, and sometimes the terms are used interchangeably, e.g. lateral plate mesoderm/mesenchyme." ;
    :has_exact_synonym "mesenchymal tissue",
        "mesenchyme tissue",
        "portion of mesenchymal tissue",
        "portion of mesenchyme tissue" ;
    :has_related_synonym "mesenchyma" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:cranium rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :skull ],
        :subdivision_of_skeletal_system ;
    :has_definition "Upper portion of the skull that excludes the mandible (when present in the organism)." ;
    :has_exact_synonym "bones of cranium",
        "ossa cranii",
        "set of bones of cranium",
        "skull minus mandible",
        "upper part of skull" ;
    :has_related_synonym "calvarium",
        "epicranial plate",
        "skeletal system of head" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:skull rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :cranium ],
        [ a owl:Restriction ;
            owl:onProperty :has_part ;
            owl:someValuesFrom :skeleton_of_lower_jaw ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :head ],
        [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :cranial_skeletal_system ],
        :caro_0000000,
        :structure_with_developmental_contribution_from_neural_crest,
        :subdivision_of_skeletal_system ;
    :has_definition "Anatomical structure that is part of the head consisting entirely of cranium and mandible[WP]." ;
    :has_related_synonym "cranial skeleton",
        "skeletal system of head" .

@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:reproductive_organ rdfs:subClassOf :organ,
        :reproductive_structure ;
    :has_definition "An organ involved in reproduction." ;
    :has_exact_synonym "genital organ",
        "reproductive system organ",
        "sex organ" ;
    :has_related_synonym "genitalia" .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

:shell_septum rdfs:subClassOf [ a owl:Restriction ;
            owl:onProperty :part_of ;
            owl:someValuesFrom :shell ],
        :septum ;
    owl:equivalentClass [ owl:intersectionOf [ rdf:first :septum ;
                    rdf:rest [ rdf:first [ a owl:Restriction ;
                                    owl:onProperty :part_of ;
                                    owl:someValuesFrom :shell ] ;
                            rdf:rest :nil ] ] ] ;
    :has_definition "Septum that divides the internal chambers (camerae) of the shell of a cephalopod, namely nautiloids or ammonoids." .

@prefix owl: <http://www.w3.org/2002/07/owl#> .
@prefix rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#> .
@prefix rdfs: <http://www.w3.org/2000/01/rdf-schema#> .

